Handling User Input


    var basePath = "/";
    if (window.location.hostname === "axellience.github.io")
        basePath = "/vue-gwt/";

    var script = document.createElement("script");
    script.src = basePath + "resources/scripts/VueGwtExamples.nocache.js";
    document.head.appendChild(script);


Events
To let users interact with your app, we can use the v-on directive to attach event listeners that invoke methods on our Vue instances:

    {{ message }}
    Add an explanation mark


@JsType
@Component
public class ExclamationComponent extends VueComponent {
    public String message;

    @Override
    public void created() {
        this.message = "Hello Vue GWT!";
    }

    public void addExclamationMark() {
        this.message += "!";
    }
}






Note in the addExclamationMark method we simply update the state of our app without touching the DOM - all DOM manipulations are handled by Vue, and the code you write is focused on the underlying logic.
You can even call the addExclamationMark from your browser's console:
exclamationComponent.addExclamationMark();
The v-model Directive
Vue also provides the v-model directive that makes two-way binding between form input and app state a breeze:

    {{ message }}



@JsType
@Component
public class MessageComponent extends VueComponent {
    public String message;

    @Override
    public void created() {
        this.message = "Hello Vue GWT!";
    }
}

Changing the value of the input will automatically update the content of our message property.
Changing the value of our Java property will change the value of input:






    It's important to note that for now in Vue GWT only JsInterop properties can be used directly in v-model.
    Check here to see why and get solutions.


A real world application is never just one Component, let's see how to compose Components together.

introduction/composing-with-components.h.body:
Composing with Components


    var basePath = "/";
    if (window.location.hostname === "axellience.github.io")
        basePath = "/vue-gwt/";

    var script = document.createElement("script");
    script.src = basePath + "resources/scripts/VueGwtExamples.nocache.js";
    document.head.appendChild(script);


The component system is another important concept in Vue, because it’s an abstraction that allows us to build large-scale applications composed of small, self-contained, and often reusable components.
If we think about it, almost any type of application interface can be abstracted into a tree of components.
Creating a Child Component
Let's create a child Component called TodoComponent.
We will then instantiate this component in an ParentComponent.
This Component will display a simple message.
TodoComponent.java
We first create a Class like for our previous examples.
@JsType
@Component
public class TodoComponent extends VueComponent {
    @Override
    public void created() {}
}

We then create an HTML file with our Component template.
We add this file next to our Java class as before.
TodoComponent.html

    I'm an amazing Todo!


ParentComponent.java
We will then create our ParentComponent that uses TodoComponent.
We first register TodoComponent to be used in our ParentComponent by passing it to the @Component annotation.
@JsType
@Component(components = {TodoComponent.class})
public class ParentComponent extends VueComponent {
    @Override
    public void created() {}
}

ParentComponent.html
Now you can compose it in our ParentComponent’s template:











Passing Properties to Children Components
Right now we render the same text for every todo, which is not super interesting.
We should be able to pass data from the parent scope into child components.
Let’s modify our TodoComponent to make it accept a property.
TodoComponent.java
@JsType
@Component
public class TodoComponent extends VueComponent {
    @Prop
    public Todo todo;

    @Override
    public void created() {}
}

The @Prop annotation tells Vue GWT that our todo property will be passed from a parent component.
TodoComponent.html

    {{ todo.getText() }}


TodoListComponent.java
Let's see how to pass this value from the parent.
We create a list of Todos like before.
Let's call it TodoListComponent:
@JsType
@Component(components = {TodoComponent.class})
public class TodoListComponent extends VueComponent {
    public JsArray todos;

    @Override
    public void created() {
        this.todos = new JsArray<>();
        this.todos.push(new Todo("Learn Java"));
        this.todos.push(new Todo("Learn Vue GWT"));
        this.todos.push(new Todo("Build something awesome"));
    }
}

TodoListComponent.html
And now we are able to pass the Todo into each repeated component using v-bind:












This is just a contrived example, but we have managed to separate our app into two smaller units, and the child is reasonably well-decoupled from the parent via the props interface.
We can now further improve our  component with more complex template and logic without affecting the parent app.
In a large application, it is necessary to divide the whole app into components to make development manageable.
We will talk a lot more about components later in the guide, but here’s an (imaginary) example of what an app’s template might look like with components:








How Is the Component Html Name Set?
The name of the html element for our Component in the template (here, todo) is determined using the Component's Class name.
The name is converted from CamelCase to kebab-case.
If the name ends with "Component" this part is dropped.
For example:

TodoComponent -> todo
TodoListComponent -> todo-list
Header -> header

Registering Components Globally
Components can also be registered globally.
They will then be usable in any Component in your app.
You won't need to pass the Class of your Component to the components attribute in the @Component annotation.
public class RootGwtApp implements EntryPoint {
    public void onModuleLoad() {
        // Register TodoComponent globally
        Vue.registerComponent(TodoComponent.class);
    }
}

This is the equivalent of calling Vue.component(...) in Vue.js.
To understand more in depth how the Observation works, and avoid pitfalls it's recommended to read information on the Vue Instance.
Your shiny new Vue GWT Components will play nicely with GWT.
Checkout integration with GWT.

essential/the-vue-instance.html.body:
The Vue Instance
This page comes from the official Vue.js documentation and has been adapted for Vue GWT.
Constructor
Every Vue vm is bootstrapped by creating a root Vue instance with the Vue.attach() method:
DemoComponent vm = Vue.attach("#container", DemoComponent.class);

Although not strictly associated with the MVVM pattern, Vue's design was partly inspired by it.
As a convention, we often use the variable vm (short for ViewModel) to refer to our Vue instances.
Vue.js requires options to configure your Vue instance.
Vue GWT generate those for you based on your VueComponent class and various annotations.
In Vue.js it's possible to extend the Vue default constructor to generate several Components with the same options.
In Vue GWT we use the Factory design pattern:
VueComponentFactory demoFactory = Vue.extend(DemoComponent.class);

DemoComponent demoComponent = demoFactory.build();
demoComponent.$mount("#myContainer");

Although it is possible to create extended instances imperatively, most of the time it is recommended to compose them declaratively in templates as custom elements.
For now, you just need to know that all Vue components are essentially extended Vue instances.
Vue GWT configure those instance for you, but in the browser they really are just regular Vue instance.
Observation
Let's talk a little about how Vue.js deals with observation.
VueComponent to Vue.js Data Model
In Vue.js you pass all the data you want to observe as the data option of your Vue constructor.
This data object is built for you by Vue GWT based on the public properties of your VueComponent.
For example this VueComponent:
@JsType
@Component
public class DemoComponent extends VueComponent {
    public Todo todo;

    @Override
    public void created() {}
}

Will have the following data object in it's Vue options:
var data = {todo: null};

Each Vue instance proxies all the properties found in its data object.
So Vue.js will automatically be warned whenever you set this.todo.
It will then recursively observe all the properties of the Object you set on this property.
For example if somewhere in your component you do:
this.todo = new Todo();

And your Todo class looks like this:
public class Todo
{
    private String text;

    public Todo(String s) {
        this.text = s;
    }

    public String getText() {
        return text;
    }
}

Then this.todo.text is automatically observed.
⚠️ Important Note on Vue GWT Observation
In Vue.js only these proxied (observed) properties are reactive.
If you attach a new property to the JS instance after it has been created, it will not trigger any view updates.
When you add your Objects to your VueComponent all their properties must already be set in the JS world.
Because of GWT optimization this is ONLY the case when you have explicitly set the property value on your instance.
In these cases the text property WON'T be observed once your app is compiled and optimized:
public class Todo {
    private String text;
    public Todo() {}
}

public class Todo {
    private String text = "Default Value";
    public Todo() {}
}

But in these cases they WILL:
public class Todo {
    private String text;
    public Todo() {
        this.text = null;
    }
}

public class Todo {
    private String text;
    public Todo() {
        this.text = "Default Value";
    }
}

Be very careful about this as the issue will only appear once your app is compiled, as GWT optimize less aggressively in dev mode.
Component Properties and Methods
In addition to data properties, Vue instances expose a number of useful instance properties and methods.
These properties and methods are prefixed with $ to differentiate them from proxied data properties.
In Vue GWT these methods and properties are defined in VueComponent, usually with the same name.
Because your Components inherits from VueComponent you can simply access them in your Components.
For example:
@JsType
@Component
public class DemoComponent extends VueComponent {
    public Todo todo;

    @Override
    public void created() {
        this.todo = new Todo();

        if (this.$data.get("todo") == this.todo) {
            // true
        }

        this.$watch(() -> this.todo, (newValue, oldValue) -> {
            // Todo has changed!
        });
    }
}

Consult the Vue.js API reference for the full list of instance properties and methods.
Instance Lifecycle Hooks
Each Vue instance goes through a series of initialization steps when it is created - for example, it needs to set up data observation, compile the template, mount the instance to the DOM, and update the DOM when data changes.
Along the way, it will also invoke some lifecycle hooks, which give us the opportunity to execute custom logic.
For example, the created hook is called after the instance is created:
@JsType
@Component
public class DemoComponent extends VueComponent {
    public Todo todo;

    @Override
    public void created() {
        // Hey there, I've been created!
    }
}

There are also other hooks which will be called at different stages of the instance's lifecycle, for example mounted, updated, and destroyed.
You may have been wondering where the concept of "controllers" lives in the Vue world and the answer is: there are no controllers.
Your custom logic for a component would be split among these lifecycle hooks.
Lifecycle Diagram
Below is a diagram for the instance lifecycle. You don't need to fully understand everything going on right now, but this diagram will be helpful in the future.
Diagram from the official Vue.js documentation

essential/computed-and-watchers.html.body:
Computed Properties and Watchers


    var basePath = "/";
    if (window.location.hostname === "axellience.github.io")
        basePath = "/vue-gwt/";

    var script = document.createElement("script");
    script.src = basePath + "resources/scripts/VueGwtExamples.nocache.js";
    document.head.appendChild(script);


This page comes from the official Vue.js documentation and has been adapted for Vue GWT.
Computed Properties
In-template expressions are very convenient, but they are really only meant for simple operations.
Putting too much logic into your templates can make them bloated and hard to maintain. For example:

  {{ new StringBuilder(message).reverse().toString() }}


At this point, the template is no longer simple and declarative.
You have to look at it for a second before realizing that it displays message in reverse.
The problem is made worse when you want to include the reversed message in your template more than once.
That's why for any complex logic, you should use a computed property.
Basic Example

  Original message: "{{ message }}"
  Computed reversed message: "{{ reversedMessage }}"


@JsType
@Component
public class ReverseComponent extends VueComponent
{
    public String message;

    @Override
    public void created() {
        this.message = "Hello";
    }

    @Computed // Note the annotation that tells Vue GWT that this is a Computed Properties
    public String getReversedMessage() {
        return new StringBuilder(message).reverse().toString();
    }
}

Result:





Here we have declared a computed property reversedMessage.
For this we declared a getter method getReversedMessage() following the Java bean naming convention.
The method we provided will be used as the getter function for the property reversedMessage of your template.
You can open the console and play with the example vm yourself.
The value of reverseComponent.reversedMessage is always dependent on the value of reverseComponent.message.
console.log(reverseComponent.reversedMessage); // -> 'olleH'
reverseComponent.message = 'Goodbye';
console.log(reverseComponent.reversedMessage); // -> 'eybdooG'

You can data-bind to computed properties in templates just like a normal property.
Vue is aware that reversedMessage depends on message, so it will update any bindings that depend on reversedMessage when message changes.
And the best part is that we've created this dependency relationship declaratively: the computed getter function has no side effects, which makes it easy to test and reason about.
Computed Caching vs Methods
You may have noticed we can achieve the same result by invoking a method in the expression:
Reversed message: "{{ getReversedMessage() }}"

@JsType
@Component
public class ReverseComponent extends VueComponent
{
    public String message;

    @Override
    public void created() {
        this.message = "Hello";
    }

    // Note that there a no more @Computed annotation
    public String getReversedMessage() {
        return new StringBuilder(message).reverse().toString();
    }
}

Instead of a computed property, we can define the same function as a method instead.
For the end result, the two approaches are indeed exactly the same.
However, the difference is that computed properties are cached based on their dependencies.
A computed property will only re-evaluate when some of its dependencies have changed.
This means as long as message has not changed, multiple access to the reversedMessage computed property will immediately return the previously computed result without having to run the function again.
This also means the following computed property will never update, because new Date() is not a reactive dependency:
@Computed
public String getNow() {
    return new Date().toString();
}

In comparison, a method invocation will always run the function whenever a re-render happens.
Why do we need caching?
Imagine we have an expensive computed property A, which requires looping through a huge Array and doing a lot of computations.
Then we may have other computed properties that in turn depend on A.
Without caching, we would be executing A’s getter many more times than necessary!
In cases where you do not want caching, use a method instead.
Computed vs Watched Property
Vue does provide a more generic way to observe and react to data changes on a Vue instance: watch properties.
When you have some data that needs to change based on some other data, it is tempting to overuse watch - especially if you are coming from an AngularJS background.
However, it is often a better idea to use a computed property rather than an imperative watch callback. Consider this example:
{{ fullName }}

@JsType
@Component
public class JohnSnowComponent extends VueComponent
{
    public String firstName;
    public String lastName;
    public String fullName;

    @Override
    public void created() {
        this.firstName = "John";
        this.lastName = "Snow";
        this.fullName = "John Snow";
    }

    @Watch(propertyName = "firstName")
    public void watchFirstName(String newValue) {
        this.fullName = newValue + " " + this.lastName;
    }

    @Watch(propertyName = "lastName")
    public void watchLastName(String newValue) {
        this.fullName = this.firstName + " " + this.newValue;
    }
}

The above code is imperative and repetitive. Compare it with a computed property version:
@JsType
@Component
public class JohnSnowComponent extends VueComponent
{
    public String firstName;
    public String lastName;

    @Override
    public void created() {
        this.firstName = "John";
        this.lastName = "Snow";
    }

    @Computed
    public String getFullName() {
        return this.firstName + " " + this.lastName;
    }
}

Much better, isn't it?
Computed Setter
Computed properties are by default getter-only, but you can also provide a setter when you need it:
@JsType
@Component
public class JohnSnowComponent extends VueComponent
{
    public String firstName;
    public String lastName;

    @Override
    public void created() {
        this.firstName = "John";
        this.lastName = "Snow";
    }

    @Computed
    public String getFullName() {
        return this.firstName + " " + this.lastName;
    }

    @Computed
    public void setFullName(String fullName) {
        String[] split = fullName.split(" ");
        this.firstName = split[0];
        this.lastName = split[1];
    }
}

Now when you run this.fullName = 'John Doe', the setter will be invoked and this.firstName and this.lastName will be updated accordingly.
We also follow the Java bean naming convention, so setFullName is a setter for the fullName property.
If you need/want to, you can override the name of the property by passing it to the @Computed annotation:
@Computed(propertyName = "myProperty")
public String someMethodName() {
    // Return something
}

Watchers
While computed properties are more appropriate in most cases, there are times when a custom watcher is necessary.
That's why Vue provides a more generic way to react to data changes through the watch option.
This is most useful when you want to perform asynchronous or expensive operations in response to changing data.
In Vue GWT we use the @Watch annotation on a method to indicate it as a watcher.
The mandatory propertyName attribute of the annotation indicate the property to watch.
Here is an example:
@JsType
@Component
public class JohnSnowComponent extends VueComponent
{
    public String message;

    @Override
    public void created() {
        this.message = "Hello World!";
    }

    @Watch(propertyName = "message")
    public void watchMessage(String newValue, String oldValue) {
        // Do something asynchroneous
    }
}


    Like for v-model, only JsInterop expression can be used as propertyName.
    This means any attribute from your Component and any of their attributes as long as they have the @JsProperty annotation.
    The following: @Watch(propertyName = "todo.text") won't work if the attribute text of the class Todo doesn't have the @JsProperty annotation.


In addition to the watch option, you can also use the imperative vm.$watch API.
This allow you to watch non JsInterop properties:
this.$watch(
    () -> this.todo.getText(),
    (newValue, oldValue) -> {
        // Do something
    }
);

essential/class-and-style.html.body:
Class and Style Bindings
This page comes from the official Vue.js documentation and has been adapted for Vue GWT.
A common need for data binding is manipulating an element's class list and its inline styles.
Since they are both attributes, we can use v-bind to handle them: we just need to calculate a final string with our expressions.
However, meddling with string concatenation is annoying and error-prone.
For this reason, Vue provides special enhancements when v-bind is used with class and style.
In addition to strings, the expressions can also evaluate to objects or arrays.
Binding HTML Classes
JSON Syntax
We can pass JSON to v-bind:class to dynamically toggle classes:


The above syntax means the presence of the active class will be determined by the truthiness of the data property isActive.
If your expression is not just a literal (it contains a space) you MUST put it between quotes.
For example:
 5' }">

This is a specificity from Vue GWT.
It's because those expressions are parsed as very loose JSON.
We are using the jodd JSON parser in it's loose mode.
It's pretty forgiving, but still won't accept values with spaces without quotes.
You can have multiple classes toggled by having more fields in the object.
In addition, the v-bind:class directive can also co-exist with the plain class attribute.
So given the following template:



And the following data:
this.isActive = true;
this.hasError = false;

It will render:


When isActive or hasError changes, the class list will be updated accordingly.
For example, if hasError becomes true, the class list will become "static active text-danger".
You can also pass a JsObject Object with keys/values:


this.classObject = new JsObject();
this.classObject.set("active", true);
this.classObject.set("text-danger", true);

A JsObject is a special Java class that will be represented as a native JS Object in the browser.
You can see it as a Map (key/values).
This will render the same result. We can also bind to a computed property that returns a JsObject.
This is a common and powerful pattern:


@JsType
@Component
public class StylishComponent extends VueComponent
{
    public boolean isActive;
    public Error error;

    @Override
    public void created() {
        this.isActive = true;
        this.error = null;
    }

    @Computed
    public JsObject getClassObject() {
        JsObject classObject = new JsObject();
        classObject.set("active", this.isActive && this.error == null);
        classObject.set("text-danger", this.error != null && this.error.getType() == ErrorType.FATAL);
        return classObject;
    }
}

Array Syntax
We can pass an array to v-bind:class to apply a list of classes:


this.activeClass = "active";
this.errorClass = "text-danger";

Which will render:


