If you know Vue.js then you know that the data property of your Component must be a function.
Vue GWT manage this for you and pass a function so that all your Components have separate data models.
When parsing your the Component class we build a dataObject Object for you. For example a Component like this:
@JsType
@Component
public class StarkComponent extends VueComponent {
    public String winter;
    public boolean is;
    public String coming;

    @Override
    public void created() {}
}

Will result in the following dataObject Object:
var dataObject = {
    winter: null,
    is: null,
    coming: null
};

To get a new instance of this dataObject Object to every Component, Vue GWT uses JSON.parse and JSON.stringify.
So the data function passed to Vue.js looks like this:
var options = {
    data: function () {
        return JSON.parse(JSON.stringify(dataObject));
    }
}

In all the examples we always initialize our Component's properties in the created method.
The reason is that even if simple values (int, boolean, String) would work once duplicated, Java Object instances wouldn't.
So to avoid confusion and errors, it's better to always assign your initial values in the created method.
